import { Component, OnInit } from '@angular/core';
import { Location } from '@angular/common';
import { Cart } from '../common/cart';
import { CartItem } from '../common/cartItem';

@Component({
  selector: 'app-rent-info',
  templateUrl: './rent-info.component.html',
  styleUrls: ['./rent-info.component.css']
})
export class RentInfoComponent implements OnInit {

  dummyDisplayData: any;      // display dummy data for selected field from home template
  searchKey: any;             // Data selected from [home.component.ts]

  dummyCart: CartItem[] = [               // dummy object array data for card
    { id: 1, key: 'default', price: 200, address: 'default' },
    { id: 2, key: 'default1', price: 200, address: 'default1' },
    { id: 3, key: 'default2', price: 200, address: 'default2' },
    { id: 4, key: 'default3', price: 200, address: 'default3' },
    { id: 5, key: 'default4', price: 200, address: 'default4' },
    { id: 6, key: 'default5', price: 200, address: 'default5' }
  ];

  dummyPic = 'data:image/jpeg;base64,';

  constructor(private location: Location, private globalCart: Cart) { }

  ngOnInit() {
    // get Data from History.state using Angular Location
    this.searchKey = this.location.getState();
    // if searchKey length is more than one (with Data)
    if (Object.keys(this.searchKey).length > 1) {
      this.dummyDisplayData = JSON.stringify(this.searchKey);
    } else {                  // if searchKey length is one (because of naviagtion id only exists)
      this.dummyDisplayData = 'Empty';
    }
  }

  // click [Select] button from [rent-info.component.html]
  addSendMe(data: CartItem) {
    // if there is no item in globalCart, add item
    if (!this.globalCart.cart) {
      this.globalCart.addItem(data);
    } else {        // if item exists
      // update item
      this.globalCart.updateItem(data);
    }

    console.log(this.globalCart);
  }

}
